const videos = [
    {
        name: 'Video1',
        duration: 15,

    },
    {
        name: 'ПорноПриколы',
        duration: 15,

    },
    {
        name: 'Роблокс',
        duration: 15,

    }
]
export function VideoList(){
    return (
        <>
        <h1>VideoList</h1>
        {
            videos.map((video)=>{
                return(
                    <div>
                        <p>video.d</p>
                        <p></p>
                        <button>Просмотреть</button>
                    </div>
                )
            })
        }
        </>
    )
}
